.generalmodal {
    .modal-dialog {
        max-width: 1018px;
        border-radius: 0;
    }

    .modal-body  {
        padding: 0;
        
    }

    .modal-content {
        border-radius: 0;
        border: none;
    }

    .constop {
        padding: 70px 60px 55px 60px;
    }

    .title {
        color: #2A332D;
        font-size: 40px;
        font-family: "Tenor Sans", sans-serif;
        line-height: 110%;
        text-transform: uppercase;
        margin: 0;

        span {
            display: block;
            padding-left: 50px;
        }
    }

    .descr {
        p {
            font-size: 14px;
            color: #231F20;


            &:last-child {
                margin-bottom: 0;
            }
        }
    }

    form {
        margin-top: 70px;
    }

    .inputfield {
        margin-bottom: 55px;

        input {
            width: 100%;
            height: 56px;
            border: none;
            background: transparent;
            border-bottom: 1px solid rgba(#595E49, 0.6);
            color: #595E49;
            font-size: 18px;
            font-family: "Montserrat", sans-serif;
        }
    }

    .submbtn {
       height: 55px;
    }

    .consbott {
        img {
            width: 100%;
        }
    }
}

.closemodal {
    border: none;
    padding: 0;
    outline: none;
    background: transparent;
    width: 35px;
    height: 35px;
    position: absolute;
    top: 14px;
    right: 14px;
    cursor: pointer;
    z-index: 2;

    img {
        width: 100%;
    }

}

.propdescr {
    padding: 100px 43px 30px;
}

@media(max-width:1599.8px) {
    .generalmodal .title {
        font-size: 32px;
    }

    .generalmodal .modal-dialog {
        max-width: 900px;
    }

    .generalmodal .constop {
        padding: 70px 30px 30px 30px;
    }

    .generalmodal form {
        margin-top: 40px;
    }

    .generalmodal .inputfield input {
        font-size: 16px;
    }

    .generalmodal .inputfield {
        margin-bottom: 30px;
    }

}

@media(max-width:991.8px) {
    .generalmodal .modal-dialog {
        max-width: 700px;
    }

    .generalmodal .title {
        margin-bottom: 20px;
    }

    .generalmodal .descr p {
        font-size: 16px;
    }
}

@media(max-width:767.8px) {
    .generalmodal .modal-dialog {
        max-width: 500px;
    }

    .generalmodal .constop {
        padding: 60px 30px 30px 30px;
    }
}

@media(max-width:575.8px) {
    .generalmodal .title {
        font-size: 24px;
        padding-right: 40px;
    }

    .generalmodal .constop {
        padding: 40px 20px 30px 20px;
    }

    .generalmodal .descr p {
        font-size: 15px;
    }

    .generalmodal form {
        margin-top: 15px;
    }

    .generalmodal .inputfield {
        margin-bottom: 20px;
    }

    .generalmodal .submbtn {
        height: 50px;
        width: 100%;
        max-width: 100%;
        margin-top: 15px;
    }

    .consbott {
        display: none;
    }

}
